export default {
  setData(data) {
    return {
      type: 'SET_DATA',
      data
    }
  },
  setDataById(dataById) {
    return {
      type: 'SET_DATA',
      dataById
    }
  },
  setTotalPages(totalPages) {
    return {
      type: 'SET_DATA',
      totalPages
    }
  }
}
